import './navBar.css'
import Images from '../back-images/back';


const NavBar = () => {
    return (

        <div>
            <div style={{
                width: "15px",
                height: "15px",
                backgroundSize: 'cover',
                backgroundImage: `url(${Images.Img})`
            }}></div>
            <nav>
               <ul>
                <li><a href="">Home</a></li>
                <li><a href="">Terms and Conditions</a></li>
                <li><a href="">Privacy policy</a></li>
               </ul>
            </nav>
        </div> 


    );
};

export default NavBar;
